import React, {useEffect, useState} from "react";
import Axios from "axios";
import { connect } from "react-redux";

const SavedRecipesPage = ({username}) => {

    const [recipeList, setRecipeList] = useState([]);

    const getRecipes = () => {
        Axios.post("http://localhost:3001/getrecipes", {
        username: username,
        }).then((response) => {
            setRecipeList(response.data);
            console.log(response.data);
        });
    };

    useEffect(() => {
        getRecipes();
    }, []);



    return (
        <div>
            <div>Saved Recipes</div>
            {recipeList.length > 0 && recipeList.map((element, i) => (
                <div key={i} className="recipe-card">
                    <img src={element.image} />
                    <span className="recipe-card-title">{element.title}</span>
                    <span className="recipe-card-url">{element.url}</span>   
                </div>
            ))}
        </div>
    )
}

const mapStateToProps = (state) => ({
    username: state.username
  });

export default connect(mapStateToProps)(SavedRecipesPage);
